  \"2016-07-27T23:02:08.031064\",\n\t\"name\": \"anwr-progress-report-number-fy84-11-ecology-of-brown-bears-inhabiting-the-coastal-plain-an\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The report covers the ecology of brown
  bears inhabiting the coastal plain and adjacent foothills and mountains of the northeastern
  portion of the Arctic National Wildlife Refuge. Fifty brown bears (Ursus arctos)
  were captured between 23 June and 3 July 1982 and an additional 30 bears were captured
  between 28 May and 16 June 1983 in the coastal plain and adjacent foothills and
  mountains of the northeastern portion of the Arctic National While Refuge (ANWR).
  Radio-transmitters were attached to total of 60 different bears during this time
  period and these bears were monitored through denning (October-November) in both
  years.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
